Sorry! I didn't know about the AndroidComments live template. You can enable it for Flutter and Dart by adding Dart to the list of applicable elements. Click the `Change` button near the bottom of the preferences/settings page:

<img width="1206" alt="screen shot 2018-12-05 at 8 32 46 am" src="https://user-images.githubusercontent.com/8518285/49528215-659ee700-f868-11e8-81b4-02821dc58bbb.png">

@devoncarew @pq This is a pretty cool feature. We should consider enabling it by default, and if not, making it more discoverable. This is defined by IntelliJ, not Android Studio.
